import React, { Component } from 'react';

import { NavLink } from 'react-router-dom';
// Icons
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faBookmark as bookmarkActive, faUser as userActive, faSearch as search, faCaretDown as darr, faFolderOpen as jobsActive, faCommentAlt as logoActive, faSignInAlt as login, faBars as menu, faCog as settings, faCogs as settingsActive, faSignOutAlt as signoutIcon } from '@fortawesome/free-solid-svg-icons'
// import { faBookmark as bookmark, faUser as user, faFolderOpen as jobs, faCommentAlt as logo } from '@fortawesome/free-regular-svg-icons'

class Nav extends Component {
    state = {

    };

    render () {
        return (
            <>
                <div className="mobile-menu show-on-mobile">
                    <h1><NavLink to="/"><img src="https://i.imgur.com/trdF8yX.jpg" className="header-profile" /> Siraj Chokshi</NavLink></h1>
                    <button className="gh-svg-wrapper" onClick="toggleMenu(this)">
                        <svg x="0px" y="0px" width="100%" viewBox="0 0 96 96" className="gh-svg gh-svg-top"
                             enable-background="new 0 0 96 96">
                            <rect width="32" height="4" x="32" y="46" className="gh-svg-rect gh-svg-rect-top"></rect>
                        </svg>
                        <svg x="0px" y="0px" width="100%" viewBox="0 0 96 96" className="gh-svg gh-svg-bottom"
                             enable-background="new 0 0 96 96">
                            <rect width="32" height="4" x="32" y="46" className="gh-svg-rect gh-svg-rect-bottom"></rect>
                        </svg>
                    </button>
                </div>
                <div className="mobile-pullout show-on-mobile" id="pullout">
                    <ul>
                        <li><a href="index.html" className="active">Home</a></li>
                        <li><a href="work.html">Work</a></li>
                        <li><a href="about.html">About</a></li>
                        <li><a href="resume.html">Resume</a></li>
                    </ul>
                </div>
                <nav className="row">
                    <div className="columns six hide-on-mobile">
                        <h1><a href="index.html"><img src="https://i.imgur.com/trdF8yX.jpg" className="header-profile" /> Siraj Chokshi</a></h1>
                    </div>
                    <div className="columns six hide-on-mobile">
                        <ul>
                            <li><a href="index.html" className="active">Home</a></li>
                            <li><a href="work.html">Work</a></li>
                            <li><a href="about.html">About</a></li>
                            <li><a href="resume.html">Resume</a></li>
                        </ul>
                    </div>
                </nav>
            </>
        )
    }
}
export default Nav;
